/* eslint-disable prettier/prettier */

import Products from '../components/Products';
import Header from '../components/Header';
import Pagination from '../components/Pagination';

export default function ProductsPage() {
    return (
        <div>
            <Header />

            <Products />
            <Pagination page={1}/>
        </div>
    );
}
